        setYear(event.target.vlaue);
        console.log(year);
    }
    return(
    <div>
        <option onChange={Change}>
            <select value="2022">2022</select>
            <select value="2021">2021</select>
            <select value="2020">2020</select>
            <select value="2019">2019</select>
        </option>
    </div>
    );
}
export default Filter;
